import React from 'react';
import { motion } from 'framer-motion';

const Resume = () => {
  return (
    <section id="resume" className="py-20 px-6 text-center bg-secondary">
      <h2 className="text-4xl font-serif text-primary mb-6">Resume</h2>
      <p className="mb-4">You can download my resume below:</p>
      <motion.a 
        href="/resume.pdf" 
        download 
        className="px-6 py-3 border border-primary text-primary hover:bg-primary hover:text-white transition-all"
        whileHover={{ scale: 1.1 }}
      >
        Download Resume
      </motion.a>
    </section>
  );
};

export default Resume;
